import img1 from '../../public/assets/images/brand/1.jpg';
import img2 from '../../public/assets/images/brand/2.jpg';
import img3 from '../../public/assets/images/brand/3.jpg';
import img4 from '../../public/assets/images/brand/4.jpg';


const Branddata = [
  {
    id: 1,
    img: img1,
    desc: 'Mobile Optimized',
  },
  {
    id: 2,
    img: img2,
    desc: 'Lightning Fast',
  },
  {
    id: 3,
    img: img3,
    desc: 'Interactive and Fun',
  },
  {
    id: 4,
    img: img4,
  },
  {
    id: 5,
    img: img1,
  },
  {
    id: 6,
    img: img2,
  },
  {
    id: 7,
    img: img3,
  },
  {
    id: 8,
    img: img4,
  },
];

export default Branddata
